svg.script:
  document.addEventListener("DOMContentLoaded", animate);
  function animate(e) {
   var w1l = document.getElementById('w1').getElementsByTagName( 'line' )[0];
   var w2l = document.getElementById('w2').getElementsByTagName( 'line' )[0];
   var w3l = document.getElementById('w3').getElementsByTagName( 'line' )[0];
   var w1a = document.getElementById('w1').getElementsByTagName( 'polyline' )[0];
   var w2a = document.getElementById('w2').getElementsByTagName( 'polyline' )[0];
   var w3a = document.getElementById('w3').getElementsByTagName( 'polyline' )[0];
   var w1d = document.getElementById('w1d');
   var w2d = document.getElementById('w2d');
   var w3d = document.getElementById('w3d');
   var w1c = document.getElementById('w1c');
   var w2c = document.getElementById('w2c');
   var w3c = document.getElementById('w3c');
   var l = 8000; var t = 16; var s = 0; var x = 0; var m=''; var z=0; var x1=0; var y1=0;
   var w1z = 0.5; var w2z = 0; var w3z = 2.3;
   //w1c.setAttribute('transform', 'matrix(1.2 -0.22 -0.4 1.44 '+(50)+' '+(-55)+')');

   setInterval(function () {
     if(window.getComputedStyle(w1c).getPropertyValue('animation-play-state')=='paused'){return true}
	 if(s >= l) s=0;

	 if(x<=0.333){
		z=(1-6*Math.abs(x-0.16666))*(w1z-1)+1;
		m='matrix('+(0.6875 + 0.400391/(0.28125 + z))+' '+((0.171875 + (-0.515625 + 0.34375*z)*z)/(-0.140625 + 
			z*(-0.21875 + z)))+' '+(0.625 - 0.800781/(0.28125 + z))+' '+(0.3125 + 0.880859/(0.28125 + z))+' '+
			(-78.125 + 100.098/(0.28125 + z))+' '+((42.9688 + z*(-128.906 + 85.9375*z))/(-0.140625 + z*(-0.21875 + z)))+')';
		x1=(356.699-250)*(z-1); y1=(33.875-250)*(z-1)
		w1l.setAttribute('x2', 356.699+x1); w1l.setAttribute('y2', 33.875+y1);
		w1a.setAttribute('transform', 'translate('+x1+','+y1+')');
		w1d.setAttribute('transform', 'translate('+x1+','+y1+')');
	 } else if(x<=0.666){
		z=(1-6*Math.abs(x-0.5))*(w2z-1)+1;
		m='matrix('+(0.117647 + 1.06401/(0.205882 + z))+' '+(-0.235294 + 0.283737/(0.205882 + z))+' '+(-0.441176 + 0.532007/(0.205882 + z))+
			' '+(0.882353 + 0.141869/(0.205882 + z))+' '+
			(330.882 - 399.005/(0.205882 + z))+' '+(88.2353 - 106.401/(0.205882 + z))+')';
		x1=(33.671-250)*(z-1); y1=(141.813-250)*(z-1)
		w2l.setAttribute('x2', 33.671+x1); w2l.setAttribute('y2', 141.813+y1);
		w2a.setAttribute('transform','translate('+x1+','+y1+')');
		w2d.setAttribute('transform','translate('+x1+','+y1+')');
	 } else {
		z=(1-6*Math.abs(x-0.83333))*(w3z-1)+1;
		m='matrix('+(0.9375 + 0.160156/(1.5625 + z))+' '+(-0.1875 + 0.480469/(1.5625 + z))+' '+(-0.3125 + 0.800781/(1.5625 + z))+
			' '+(0.0625 + 2.40234/(1.5625 + z))+' '+
			(93.75 - 240.234/(1.5625 + z))+' '+(281.25 - 720.703/(1.5625 + z))+')';
		x1=(269.242-250)*(z-1); y1=(351.063-250)*(z-1)
		w3l.setAttribute('x2', 269.242+x1); w3l.setAttribute('y2', 351.063+y1);
		w3a.setAttribute('transform', 'translate('+x1+','+y1+')');
		w3d.setAttribute('transform', 'translate('+x1+','+y1+')');
	 }
	 w3c.setAttribute('transform', m);
	 w2c.setAttribute('transform', m);
	 w1c.setAttribute('transform', m);

	 s=s+t; x=Math.min(1, s/l)
    }, t)
}
